from algorithm_utils import *

class Solution:
    """
    [面试题 17.08. 马戏团人塔](https://leetcode-cn.com/problems/circus-tower-lcci/)
    """
    @timeit
    def bestSeqAtIndex(self, height: List[int], weight: List[int]) -> int:
        arrs = [[x, y] for x, y in zip(height, weight)]
        n = len(arrs)
        arrs.sort(key=lambda x:(x[0],-x[1]))
        arr = [e[1] for e in arrs]
        # 最长上升子序列
        dp = []
        for i in range(n):
            if not dp or arr[i] > dp[-1]:
                dp.append(arr[i])
            else:
                lo, hi = 0, len(dp)
                while lo < hi:
                    mi = lo + hi >> 1
                    if dp[mi] < arr[i]:
                        lo = mi + 1
                    else:
                        hi = mi
                dp[lo] = arr[i]
        return len(dp)

